#Check machine belongs to new Win10 MOE OU before confirming if online or not
function IsClientDevice {
    $cnText.Refresh()
    $checkOU = Get-ADComputer -Identity $cnText.Text -Properties * -ErrorAction SilentlyContinue -ErrorVariable ADError
    If ($checkOU.CanonicalName -like "uniwa.uwa.edu.au/Client Devices/*") {
        $true
        Test-Connection -ComputerName $cnText.Text -Count 1 -AsJob | Get-Job | Receive-Job -Wait | Select-Object @{Name='ComputerName';Expression={$_.Address}},@{Name='Reachable';Expression={
            If ($_.StatusCode -eq 0) {
                $connectionStatus.Enabled               = $true
                $connectionStatus.Text                  = 'Machine online'
                $connectionStatus.ForeColor             = 'Green'
             } 
             Else { 
                $connectionStatus.Enabled               = $true                
                $connectionStatus.Text                  = 'Machine offline'
                $connectionStatus.ForeColor             = 'DarkRed'
                }}} 
    }
    Elseif (!($checkOU.CanonicalName -like "uniwa.uwa.edu.au/Client Devices/*")) {
        $false
        If ($ADError) {
            $connectionStatus.Text                  = ''           
            [System.Windows.Forms.MessageBox]::Show('Machine not found in Active Directory', 'Error', 'OK', 'Error')
        }
        Else {
            $connectionStatus.Text                  = ''                
            [System.Windows.Forms.MessageBox]::Show('This is not a Windows 10 MOE machine', 'Warning', 'OK', 'Warning')
        }
        
    }
}
function CheckTicketNumber {
    $tnText.Refresh()
    If ((($tnText.Text -like 'inc*') -or ($tnText.text -like 'INC*') -or ($tnText.text -like 'sctask*') -or ($tnText.text -like 'SCTASK*')) -and ($tnText.TextLength -ge 3)) {
        $true
    }
    Else {
        $false
    }
}
#Create account for local UserAdmin, function will prompt user if account expiry date is longer than 3 months
function GenerateAccount {
    $detailsText.Text = "Please wait..."
    Start-Sleep -Milliseconds 100
    $form.Refresh()
    $cnText.Refresh()
    $tnText.Refresh()
    $tnText.Text.ToString()
    $datePicker.Refresh()
    [string]$comp = $cnText.Text.ToUpper()
    [string]$ticket = $tnText.Text.ToUpper()
    [string]$date = $datePicker.Text.Trim()
    $setTime = Get-Date -Format "dd/MM/yyyy HH:mm:ss"
    $expiry = [datetime]::ParseExact($datePicker.Text, 'dd/MM/yyyy', $null) 
    If ((IsClientDevice) -and (CheckTicketNumber)) {
        If (($expiry - (Get-Date)).Days -ge 90) {
            switch ([System.Windows.Forms.MessageBox]::Show('The account expiry exceeds 3 months, was this approved by a manager?', 'Warning', 'YesNo', 'Warning')) {
                'No' {
                    Return
                }
            }
        }
        
        [int]$passwordlength = 12
        [int]$min_number = 2
        [int]$min_symbol = 2
        $word = @("Judgment","Decrease","Crossing","Nonsense","Opposite","Motorist","Priority","Slippery","Survivor","Mutation","Nominate","Complete","Particle","Struggle","Diameter","Arrogant","Mourning","Dressing","Dedicate","Economic","Designer","Possible","Mountain","Sickness","Evaluate","Reliable","Reaction","Confront","Childish","Stubborn","Rhetoric","Coincide","Surround","Explicit","Strength","Mushroom","Flourish","Baseball","Friendly","Collapse","Merchant","Register","Teenager","Generate","Cassette","Flexible","Category","Movement","Ideology","Illusion","Memorial","Greeting","Reckless","Composer","Casualty","Vertical","Syndrome","Remember","Sentence","Property","Judicial","Traction","Delivery","Relation","Mosquito","Facility","Minority","Tolerant","Railroad","Negative","Reliance","Distance","Frighten","Indirect","Prestige","Hardware","Romantic","Marriage","Proclaim","Instinct","Ancestor","Solution","Freshman","Reporter","Joystick","Midnight","Ordinary","Practice","Dramatic","Skeleton","Misplace","Building","Minister","Gradient","Division","Fragment","Elephant","Familiar","Survival","Referral","Concrete","Econobox","Patience","Minimise","Aquarium","Ignorant","Bulletin","Marathon","Congress","Computer","Triangle","Invasion","Activity","Ceremony","Seasonal","Diplomat","District","Folklore","Overview","Portrait","Daughter","Workshop","Customer","Compound","Stunning","Infinite","Threaten","Displace","Courtesy","Suitcase","Pressure","Accident","Disclose","Obstacle","Hesitate","Approval","Abundant","Consider","Shoulder","Farewell","Activate","Interest","Terminal","Director","Contrast","Occasion","Response","Broccoli","Observer","Literacy","Cemetery","Convince","Exercise","Engineer","Humanity","Faithful","Employee","Spectrum","Adoption","Appendix","Dividend","Campaign","Disgrace","Feedback","Magazine","Magnetic","Pavement","Personal","Disorder","Election","Cupboard","Shortage","Standard","Describe","Implicit","Suppress","Specimen","Absolute","Pleasant","Quantity","Progress","Vigorous","Question","Governor","Football","Scenario","Crackpot","Rational","Theorist","Argument","Sunshine","Unlikely","Approach","Restrain","Discover","Addition","Variable","Graduate") 
        $number = @(1,2,3,4,5,6,7,8,9) 
        $symbol = @("!","@","#","%","&","(",")","`"",".","<",">","+","=","-","_")
        $password = @()
        $password += Get-Random $word
        1..$min_number | % {$password += Get-Random $number}
        1..$min_symbol | % {$password += Get-Random $symbol}
        Get-Random $password -count $passwordlength | % {[string]$randomPassword += $_}
        $securePassword = ConvertTo-SecureString -String $randomPassword -AsPlainText -Force
    
        If (Invoke-Command -ComputerName $cnText.Text -ScriptBlock {Get-LocalUser -Name "UserAdmin"} -AsJob) {
            Invoke-Command -ComputerName $cnText.Text -ScriptBlock {
                Remove-LocalUser -Name "UserAdmin"
                New-LocalUser -Name "UserAdmin" -Password $Using:securePassword -AccountExpires $Using:datePicker.Text -Description $Using:tnText.Text -PasswordNeverExpires -UserMayNotChangePassword
                Add-LocalGroupMember -Group "Administrators" -Member "UserAdmin" -ErrorAction SilentlyContinue
            } -AsJob
        }
        Else {
            Invoke-Command -ComputerName $cnText.Text -ScriptBlock {
                New-LocalUser -Name "UserAdmin" -Password $Using:securePassword -AccountExpires $Using:datePicker.Text -Description $Using:tnText.Text -PasswordNeverExpires -UserMayNotChangePassword
                Add-LocalGroupMember -Group "Administrators" -Member "UserAdmin" -ErrorAction SilentlyContinue
            } -AsJob
        }
        Start-Sleep -Seconds 3
        If (Invoke-Command -ComputerName $cnText.Text -ScriptBlock {Get-LocalUser -Name "UserAdmin" | Select-Object * | Where-Object {$_.Description -eq $Using:ticket}}) {
            $detailsText.Text =  "Computer: $comp
Username: UserAdmin`
Password: $randompassword`
Ticket: $ticket`
Account Expires:  $date
Applied on: $setTime"
        }
        Else {
            $detailsText.Text = ''
        }
    
    }
    Else {
        [System.Windows.Forms.MessageBox]::Show('Confirm valid ticket number or computer name', 'Warning', 'OK', 'Warning')
    }
}

